import React from 'react';
import logo from '../Images/logo.svg';
import s from './HedNav.module.css';

export default class HedNav extends React.Component {
  state = {
    bars: false,
  };

  render() {
    return (
      <div className={s.item}>
        <nav>
          <img src={logo} />
          <ul className={s.itemUl}>
            <li>
              <a>Product</a>
            </li>
            <li>
              <a>Features</a>
            </li>
            <li>
              <a>Testimonial</a>
            </li>
            <li>
              <a>FAQ</a>
            </li>
            <li>
              <a>Pricing</a>
            </li>
            <li>
              <a>Contact Us</a>
            </li>
          </ul>
          <div className={s.icon}>
            <b>
              <i class='fas fa-bars'></i>
            </b>
          </div>
        </nav>
      </div>
    );
  }
}
